import{_ as r,c as e,o as a,a3 as t}from"./chunks/framework.7ep0oyv4.js";const u=JSON.parse('{"title":"一、dos基本命令","description":"","frontmatter":{},"headers":[],"relativePath":"network security/1.md","filePath":"network security/1.md"}'),o={name:"network security/1.md"},b=t('<h1 id="一、dos基本命令" tabindex="-1">一、dos基本命令 <a class="header-anchor" href="#一、dos基本命令" aria-label="Permalink to &quot;一、dos基本命令&quot;">​</a></h1><h2 id="_1-1-dos命令" tabindex="-1">1.1 dos命令 <a class="header-anchor" href="#_1-1-dos命令" aria-label="Permalink to &quot;1.1 dos命令&quot;">​</a></h2><h3 id="_1-基本命令" tabindex="-1">1）基本命令 <a class="header-anchor" href="#_1-基本命令" aria-label="Permalink to &quot;1）基本命令&quot;">​</a></h3><p>1、命令：color f0   帮助：cloor ？   作用：改变背景及字体颜色  <br> 2、命令：cls   作用：清屏</p><h3 id="_2-目录相关命令" tabindex="-1">2）目录相关命令 <a class="header-anchor" href="#_2-目录相关命令" aria-label="Permalink to &quot;2）目录相关命令&quot;">​</a></h3><p>3、命令：dir 作用：浏览当前文件夹的内容（带<code>&lt;dir&gt;</code>标识的为文件夹，否则为文件）<br> 其他用法： dir 指定路径<br> dir d:\\ dir d:\\pic<br> dir /a        #浏览所有内容，包括隐藏内容</p><p>4、命令：盘符   作用：切换盘符，如：c:   d:   e:  <br> 5、命令：cd..   作用：退出一级目录</p><p>6、命令：cd 文件夹名   作用：进入文件夹  <br> 7、Tab键：补全路径功能</p><p>8、命令：cd \\   作用：直接退到根目录  <br> 9、命令：md 文件夹 [文件夹 文件夹...]<br>   作用：创建文件夹<br>  <br> 10、命令：rd 文件夹 [文件夹 文件夹...]<br>   作用：删除空文件夹<br>   命令：rd 文件夹 /s /q<br>   作用：无提示删除文件夹<br>    <br> 11、路径：<br> 相对路径：针对当前路径有效，如：..\\456<br> 绝对路径：从根开始写路径，如：\\123\\345</p><h3 id="_3-文件相关命令" tabindex="-1">3）文件相关命令 <a class="header-anchor" href="#_3-文件相关命令" aria-label="Permalink to &quot;3）文件相关命令&quot;">​</a></h3><p>12、创建文件方法<br>    echo 字符串 &gt;&gt; [路径] 文件名.扩展名 &gt;&gt;为追加，&gt;为覆盖</p><p>13、命令：type 文件名.扩展名<br>   作用：浏览一个文件内容<br>   命令：type 文件名.扩展名 | more<br>   作用：分页显示文件内容</p><p>14、命令：del 文件名.扩展名<br> 作用：删除文件<br> del *.txt       # 删除所有txt结尾的文件<br> del <em>.</em>         # 删除所有文件<br> del <em>.</em> /s /q   # 无提示删除所有文件</p><h3 id="_4-隐藏命令" tabindex="-1">4）隐藏命令 <a class="header-anchor" href="#_4-隐藏命令" aria-label="Permalink to &quot;4）隐藏命令&quot;">​</a></h3><p>15、修改文件或文件夹隐藏属性<br> 命令：<br> attrib +h +s +a 文件夹/文件夹名  # 增加隐藏、系统保护、只读属性<br> # + 改为 - 为取消修改文件属性</p><h3 id="_5-复制和移动" tabindex="-1">5）复制和移动 <a class="header-anchor" href="#_5-复制和移动" aria-label="Permalink to &quot;5）复制和移动&quot;">​</a></h3><p>16、命令：<br> 复制文件：copy [路径]源文件名 [目标路径]新文件名  <br> copy con 1.txt  # 复制屏幕内容到1.txt<br> 移动文件：move [路径]源文件名 [目标路径]新文件名    #同路径默认改名<br> 改文件名：ren [路径]源文件名 新文件名</p><h3 id="_6-定时关机或重启" tabindex="-1">6）定时关机或重启 <a class="header-anchor" href="#_6-定时关机或重启" aria-label="Permalink to &quot;6）定时关机或重启&quot;">​</a></h3><p>17、命令：定时关机或重启<br> shutdown -s -t 秒        # 定时关机<br> shutdown -s -f -t 秒     # 定时强制关机<br> shutdown -r -t 秒        # 定时重启，同上加上-f，为强制重启<br> shutdown -a              # 取消定时<br> shutdown -l              # 注销，同logoff命令相同</p><h3 id="_7-其他" tabindex="-1">7）其他 <a class="header-anchor" href="#_7-其他" aria-label="Permalink to &quot;7）其他&quot;">​</a></h3><p>18、命令：fsutil file createnew 文件名.扩展名 字节<br> 作用：生成一个固定字节的空文件<br> 示例：fsutil file createnew 1.txt 4096000</p><p>19、命令：accoc.扩展名=扩展名file  <br> 作用：修改后缀关联性<br> 示例：accoc.txt=exefile</p><p>20、命令：taskkill /im 进程名<br> 命令：taskkill /pid 进程号<br> 作用：关闭进程<br> 命令：taskkill /im explorer.exe /f<br> 作用：强制杀死桌面进程</p><p>21、命令：netstat -ano<br> 作用：使用ip地址显示本机所有开放的端口，并显示pid</p><p>22、命令：net share<br> 作用：显示所有共享<br> 命令：net share 共享名 /del<br> 作用：删除共享<br> 命令：net share net share text=D:\\桌面\\text<br> 作用：共享D:\\桌面\\text<br> 命令：net use f: \\10.1.1.1\\share 密码 /user:用户名<br> 作用：映射远程共享到本地f盘，后面跟账号密码<br> ​<br> 23、命令：route print<br> 作用：显示本机路由信息</p><h2 id="_1-2-批处理" tabindex="-1">1.2 批处理 <a class="header-anchor" href="#_1-2-批处理" aria-label="Permalink to &quot;1.2 批处理&quot;">​</a></h2><p>自上而下成批的处理每一条命令，直到执行最后一条!</p><p>@echo off                    # 关闭回显功能，也就是屏蔽过程<br> title 标题                    # 为批处理脚本设置标题<br> color 0a                     # 设置底色为黑，字为绿，color ？可以查看颜色<br> pause                        # 暂停批处理运行<br> echo.                        # 在执行批处理脚本时，可以空一行</p><blockquote><p>nul 2&gt;nul                   # 执行结果不管报不报错都不提示<br> :1                           # 定义标签名  <br> goto 1                       # 实现跳转到区块1<br> start                        # 打开一个文件，什么都不写就打开cmd<br> %userprofile%                # 取变量userprofile的值<br> set a=100                    # 定义变量a=100<br> set /p a=                    # 定义变量a，用户输入值<br> taskkill /im explorer.exe /f # 强制杀死桌面进程<br> ping -n 5 127.0.0.1          # 延迟5s</p></blockquote>',29),i=[b];function l(s,d,n,c,h,p){return a(),e("div",null,i)}const f=r(o,[["render",l]]);export{u as __pageData,f as default};
